import React from 'react'
import { useState } from 'react/cjs/react.development';
import Modal from '../componets/Modal';

function Pacientes() {
    const [AcitveModal,setAcitveModal] = useState(false);
    const data = [['Covid 19','Examen Isopado '],['Antiquenos','sadad lkjadslkj']]
    return (
      <div className="container  min-h-screen">
        {AcitveModal&&<Modal cerrar={()=>setAcitveModal(false)}/>}
        <button onClick={()=>setAcitveModal(true)} className="m-4 bg-green-primary py-2 px-4 rounded-lg text-white text-lg"> + Agregar Paciente</button>

        <table className="bg-white w-8/12 mx-auto mt-6 rounded-t-lg">
          <thead className="bg-blue-primary text-white rounded-t-lg">
            <tr className="text-xl rounded-t-lg">
              <th className="rounded-tl-lg">NÂº Cedula</th>
              <th className="rounded-tr-lg">Nombre</th>
            </tr>
          </thead>
          <tbody className="text-center">
            {data.map((element,i) => {
              if(i%2===0){
                  return (
                      <tr className="bg-white">
                        <td>{element[0]}</td>
                        <td>{element[1]}</td>
                      </tr>
                    );
              }
              return (
                  <tr className="bg-gray-200">
                    <td>{element[0]}</td>
                    <td>{element[1]}</td>
                  </tr>
                );
            })}
          </tbody>
        </table>
      </div>
  )
}

export default Pacientes
